export const ongoingsRequested = () => {
    return {
        type: 'FETCH_ONGOINGS_REQUEST'
    };
};

export const ongoingsLoaded = (ongoings) => {
    return {
        type: 'FETCH_ONGOINGS_SUCCESS',
        payload: ongoings
    };
};

export const animeRequested = () => {
    return {
        type: 'FETCH_ANIME_REQUEST'
    };
};

export const animeLoaded = (anime) => {
    return {
        type: 'FETCH_ANIME_SUCCESS',
        payload: anime
    };
};

export const animesSearchListRequested = () => {
    return {
        type: 'FETCH_ANIME_SEARCH_LIST_REQUEST'
    };
};

export const animesSearchListLoaded = (animes) => {
    return {
        type: 'FETCH_ANIME_SEARCH_LIST_SUCCESS',
        payload: animes
    };
};

export const animesSearchListClear = () => {
    return {
        type: 'CLEAR_ANIME_SEARCH_LIST'
    };

}
